import * as React from "react";
import {
  Box,
  Typography,
} from "@mui/material";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

function BannerSlider() {
        const settings = {
          dots: true,
          arrows: true,
          autoplay: true,
          autoplaySpeed: 4000,
          centerMode: true,
          centerPadding: "0px",
          infinite: true,
          initialSlide: 0,
          slidesToShow: 1,
          slidesToScroll: 1,
          swipeToSlide: true,
        };
  return (
    <>
      <Box sx={{ mb: 5,mt }}>
        <Slider
          {...settings}
          sx={{
            "&.slick-dots li button:before": {
              fontSize: "16px",
            },
            "&.slick-dots li.slick-active button:before": {
              color: "#00ca9d",
            },
          }}
        >
          <Box>
            <Box
              sx={{
                backgroundColor: "#ab47bc",
                width: "100%",
                height: "350px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>
          <Box>
            <Box
              sx={{
                backgroundColor: "#9575cd",
                width: "100%",
                height: "350px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>

          <Box>
            <Box
              sx={{
                backgroundColor: "#9575cd",
                width: "100%",
                height: "350px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>
        </Slider>
      </Box>
    </>
  );
}
export default BannerSlider;
